import React from 'react';
import { Redirect } from 'react-router-dom';

const Logout = ()=>{
    const [redirect,setRedirect] = useState(false);
    ()=>{
        localStorage.removeItem('isLogin');
        setRedirect(true);
    }
    return(
        <>
            {redirect === true?<Redirect to="/user" />:null }
            <h1>Logout</h1>
        </>
    )
};

export default Logout;
